  false,\n\t\"url\": null,\n\t\"notes\": \"The Neotectonic Map of Alaska (Plafker
  and others, 1994) represents the first comprehensive compilation of tectonic faults
  and folds in Alaska and outlines the relative activity of post-Oligocene structures.
  Commonly referred to as \"the Plafker map\", this publication is out of print and
  was used as baseline information for the creation of the Quaternary fault and fold
  database for Alaska (Koehler and others, 2012).\",\n\t\"license_title\": null,\n\t\"extras\":
